import React from "react";
import Square from "./Square";

const Board = ({ squares, onClick }) => {
    return (
        <div className="board">
            {squares.map((value, index) => (
                <Square key={index} value={value} onClick={() => onclick(index)} />
            ))}
        </div>
    );
}

export default Board;
